import styled from 'styled-components'

export const StyledDetailPage2 = styled.div`
    height: 100vh; 
    display: flex; 
    flex-direction: column; 
    justify-content: center; 
    align-items: center; 
    background: green; 

    div{
        width: 400px; 
        display: flex; 
        justify-content: space-between; 
        margin: 20px 0px; 
    }
    td{
        padding-left: 80px; 
    }
`
